import React from 'react'

const Header = () => {
  return (
    <div className='header'>
        <img className='header__logo' src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.vecteezy.com%2Fvector-art%2F19040342-amazon-logo-editorial-vector&psig=AOvVaw1_Fuu40kiOalcCthSBIShN&ust=1690108011658000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCMiEj4-NooADFQAAAAAdAAAAABAE'></img>

      
    </div>
  )
}

export default Header
